-- ----------------------------
-- Table structure for rumah_nop
-- ----------------------------
DROP TABLE IF EXISTS `rumah_nop`;
CREATE TABLE `rumah_nop`  (
  `id` int(0) NOT NULL AUTO_INCREMENT,
  `kode_rumah` varchar(50) CHARACTER SET utf8mb3 COLLATE utf8mb3_swedish_ci NOT NULL,
  `nop` varchar(120) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `kode_wilayah` varchar(10) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `alamat` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `rt` char(3) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `rw` char(3) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `objek_pajak` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `luas_tanah` int(0) NULL DEFAULT NULL,
  `luas_bangunan` int(0) NULL DEFAULT NULL,
  `kelas` varchar(20) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `njop_per_m2` decimal(14, 2) NULL DEFAULT NULL,
  `total_njop` decimal(14, 2) NULL DEFAULT NULL,
  `nik_pemilik` varchar(200) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `nama_pemilik` varchar(150) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `npwp` varchar(200) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `is_taken` int(0) NOT NULL DEFAULT 0,
  `add_date` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0),
  PRIMARY KEY (`id`, `kode_rumah`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 501 CHARACTER SET = utf8mb3 COLLATE = utf8mb3_swedish_ci ROW_FORMAT = Dynamic;

