-- ----------------------------
-- Table structure for survey
-- ----------------------------
DROP TABLE IF EXISTS `survey`;
CREATE TABLE `survey`  (
  `tahun_anggaran` varchar(4) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `properti_id` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `tipe_referensi` enum('data_baru','data_nop','data_1000') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `nik` varchar(200) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `npwp_pemilik` varchar(200) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `kode_wilayah` varchar(10) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `no_hp` varchar(55) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `nama_lengkap` varchar(200) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `tingkat_pendidikan` enum('sd_mi','smp_mts','sma_ma_smk','d3_d4','s1','s2','s3') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `gender` enum('laki-laki','perempuan') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `tempat_lahir` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `tanggal_lahir` date NULL DEFAULT NULL,
  `status_perkawinan` enum('belum_kawin','kawin','janda_duda') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `alamat` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `rt` char(3) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `rw` char(3) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `lama_anda_bekerja` int(0) NULL DEFAULT NULL,
  `status_kepegawaian_anda` enum('pns_cpns_tni_polri','pegawai_tetap','pegawai_honorer','pegawai_kontrak','pegawai_harian','pemilik_usaha','tidak_bekerja') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `punya_hunian_lain` enum('ya','tidak') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `punya_tanah` enum('ya','tidak') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `jenis_aset_bergerak` enum('tidak_ada','mobil','motor') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `pernah_dapat_bantuan` enum('ya','tidak') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `nama_bantuan` varchar(225) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `luas_tanah` int(0) NULL DEFAULT NULL,
  `luas_bangunan_rumah` int(0) NULL DEFAULT NULL,
  `status_rumah` enum('milik_sendiri','kontrak_sewa','menumpang','rumah_dinas','lainnya') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `jumlah_anggota` int(0) NULL DEFAULT NULL,
  `jumlah_anak` int(0) NULL DEFAULT NULL,
  `bahan_utama_atap` enum('beton','asbes','bambu','jerami_ijuk','genteng','seng','kayu_sirap') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `bahan_utama_dinding` enum('tembok','kayu_papan','kayu_batang','plesteran_kawat','anyaman_bambu','bambu','lainnya') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `bahan_utama_lantai` enum('marmer_granit','parquet_vinyl_karpet','kayu_papan','bambu','keramik','ubin_tegel_teraso','semen_batamerah','tanah','lainnya') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `fasilitas_mck` enum('art_sendiri','ada_tertentu','ada_mck_komunal','umum_siapapun','tidak_ada') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `jenis_kloset` enum('leher_angsa','leher_angsa_plengsengan','lainnya') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `sumber_air_utama` enum('air_kemasan','ledeng','sumurbor_limbah_lebih10m','sumurlindung_limbah_lebih10m','sumurbor_limbah_kurang10m','sumurlindung_limbah_kurang10m','mata_airlindung','mata_airtaklindung','sungai_danau','isi_ulang','air_hujan','sumur_taklindung','lainnya') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `jarak_limbah` enum('>10m','<10m') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `lokasi_rumah` enum('tidak_kumuh','kumuh') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `tempat_pembuangan_tinja` enum('septic_tank_pal','lainnya') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `total_penghasilan` decimal(14, 0) NULL DEFAULT NULL,
  `tanggal_entri` datetime(0) NULL DEFAULT NULL,
  `tingkat_mbr` varchar(20) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `tingkat_kemiskinan` int(0) NULL DEFAULT NULL,
  `status_rtlh` enum('ya','tidak') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `foto_depan` varchar(225) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `foto_samping` varchar(225) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `foto_jauh` varchar(225) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `latlon` varchar(150) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `total_score` double NULL DEFAULT NULL,
  `tahun` varchar(4) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `status` int(0) NULL DEFAULT NULL,
  `memenuhi` enum('ya','tidak') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `total_score_persentase` double NULL DEFAULT NULL,
  `source_from` enum('web','mobile') CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `add_date` datetime(0) NULL DEFAULT NULL,
  `modified_date` datetime(0) NULL DEFAULT NULL,
  `add_user` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `modified_user` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  PRIMARY KEY (`tahun_anggaran`, `properti_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = Dynamic;

